@sarabala1979 - FYI, I reviewed this with @jiachengxu in person. The fix is appropriate because of the way the expr library works.

We discovered that without this change, the controller is actually doing something very wrong/unexpected: **_it rewrites the actual `.spec` field of the workflow_** to the value that expr interpreted. So this change will prevent this.

Let me know if you have any questions with the approach -- I'll hold off merging in case you still have concerns.
